import React from 'react';
import Link from 'next/link';
import AsignarCliente from '../component/pedidos/AsignarCliente';
import AsignarProductos from '../component/pedidos/AsignarProductos';
import ResumenPedido from '../component/pedidos/ResumenPedido';
import Layout from '../component/Layout';

export default function Pedidos() {
  return (
    <Layout>
      <h1 className="text-2xl text-gray-800 font-light">Crear Nuevo Pedido</h1>

      <Link href="/nuevopedido">
        <a className="bg-blue-800 py-2 px-5 mt-3 inline-block text-white rounded text-sm hover:bg-gray-800 mb-3 uppercase font-bold">
          Nuevo Pedido
        </a>
      </Link>
      <AsignarCliente />
      <AsignarProductos />
      <ResumenPedido />
    </Layout>
  );
}
